INSERT INTO `politician` VALUES (2,'정성호','http://www.assembly.go.kr/photo/9770881.jpg','경기 양주시',9770881,'대신고등학교 졸업\r\n서울대학교 법학 학사\r\n제28회 사법시험 합격\r\n사법연수원 제18기 수료\r\n육군 제3사단 법무관 복무\r\n\r\n민주사회를 위한 변호사 모임 회원\r\n의정부YMCA 이사\r\n경기북부환경운동연합 공동대표\r\n연천군청 고문변호사\r\n제17대 열린우리당 국회의원(경기 양주·동두천)\r\n법제사법위원회 위원\r\n건설교통위원회 위원\r\n열린우리당 원내부대표\r\n동두천시청 고문변호사\r\n경기도교육청 고문변호사\r\n의정부시청 고문변호사\r\n경기 교원장학재단 감사\r\n민주정책연구원 부원장\r\n제19대 민주통합당 국회의원(경기 양주·동두천)\r\n기획재정위원회 위원\r\n국회운영위원회 간사\r\n민주통합당 대변인\r\n한국·러시아 의원친선협회 간사\r\n민주당 원내수석부대표\r\n국토교통위원회 간사\r\n교통법안심사소위원회 위원장','1961-09-10 00:00:00',59,'더불어민주당'),(3,'이광재','http://www.assembly.go.kr/photo/9771198.jpg','강원 원주시갑',9771198,'전) 참여정부 국정상황실장\r\n전) 17대, 18대 국회의원\r\n전) 35대 강원도지사\r\n현) 21대 국회의원\r\n현) 더불어민주당 K-뉴딜본부장','1965-02-28 00:00:00',55,'더불어민주당'),(35,'정청래','http://www.assembly.go.kr/photo/9771114.jpg','서울 마포구을',9771114,'주요경력\r\n- 제 17·19·21대 국회의원(마포구을)\r\n-한일의원연맹 미래위원장\r\n-유네스코 한국위원회 위원\r\n- 더불어민주당 마포구(을) 지역위원장\r\n- 더불어민주당 최고위원(前)\r\n- 더불어민주당 가계부채특별위원장(前)\r\n- 제19대 국회 정보위원회 간사\r\n- 제19대 국회 안전행정위원회 간사\r\n- 제19대 국회 국정원국정조사특별위원회 간사\r\n- 제17대 국회 문화관광위원회 간사\r\n- e스포츠&amp;게임산업 발전을 위한 국회의원 모임 회장(前)\r\n- (사)한국독립유공자협회 자문위원(前)\r\n- 박영석기념관 추진위원회 위원(前)\r\n- 김근태기념치유센터 설립추진위원회 위원(前)\r\n- 더불어민주당 문재인 대통령후보 중앙선대위\r\n- 국민참여공동본부장(前)\r\n- 더불어민주당 마포구(을) 지역위원장\r\n\r\n 저서 \r\n- 정치, 알아야 세상을 바꾼다 (2019, 자음과모음)\r\n- 정세현 ？ 정청래와 함께 평양 갑시다 (2018, 푸른숲)\r\n- 정청래의 국회의원 사용법 (2016, 푸른숲)\r\n- 거침없이 정청래 (2015, 자음과모음)\r\n- 유쾌한 정치여행 (2011, 호두나무)\r\n- 정통 시사인물 셀프탐구 OK 정청래 (2011, 호두나무)\r\n- 사람만이 사람 사는 세상을 만든다 (2003, 황소걸음)','1965-04-18 00:00:00',55,'더불어민주당'),(38,'조경태','http://www.assembly.go.kr/photo/9770450.jpg','부산 사하구을',9770450,'- 제 17, 18, 19, 20, 21대 국회의원\r\n- 부산대학교 공학 박사\r\n- 전) 미래통합당 최고위원\r\n- 전) 제20대 국회 전반기 기획재정위원회 위원장\r\n- 전) 자유한국당 인재영입위원장\r\n- 현) 한·대만의원친선협회 회장','1968-01-10 00:00:00',52,'국민의힘'),(41,'조정식','http://www.assembly.go.kr/photo/9770456.jpg','경기 시흥시을',9770456,'동성고등학교 졸업\r\n연세대 건축공학과 졸업\r\n연세대 행정대학원(도시 및 지방행정) 졸업\r\n故 제정구의원 정책 보좌\r\n\r\n現 더불어민주당 정책위의장\r\n現 국회 통합과 상생 포럼 대표의원\r