원장\r\n－민주당 지방자치위원회 위원장, 조직강화 특별위원회 위원\r\n－2010년 지방선거 민주당 서울시당 공직선거 후보자추천위원회 위원\r\n－2010년 지방선거 민주당 경기도당 공직선거후보자추천 재심위원회 위원장\r\n－민주당 원내부대표\r\n－국회 국방위원회 위원, 민주당 간사\r\n－국회 독도영토 수호특별대책위원회 위원\r\n－국회운영위원회, 행정안전위원회, 문화체육관광방송위원회 위원\r\n－국회 예산결산특별위원회 위원\r\n－제18대 민주통합당 대선 선대위 총괄 조직부본부장\r\n－2013년 10월 민주당 재보궐선거기획단장\r\n－국회 국방위원회 민주당 간사\r\n－국가정보원 등 국가기관의 정치적 중립성 강화를 위한 제도개선 특별위원회 위원\r\n－국회 운영위원회 새정치민주연합 간사\r\n－새정치민주연합 원내수석부대표\r\n－더불어민주당 전략홍보본부장\r\n－더불어민주당 사무총장\r\n - 국회 국토교통위원회 위원\r\n－제19대 문재인 대통령 후보 중앙선거대책위원회 총무본부장\r\n－동국대학교 행정대학원 객원교수\r\n－더불어민주당 서울특별시당 위원장\r\n－더불어민주당 최고위원\r\n - 제20대 국회 후반기 국방위원회 위원장\r\n－더불어민주당 전국대의원대회 준비위원회 위원장\r\n\r\n\r\n - 제18대 한-벨 국회의원 친선협회 부회장\r\n - 제18대 한-노르웨이 국회의원 친선협회 이사\r\n - 제19대 한-러시아 국회의원 친선협회 회장\r\n - 제19대 한-노르웨이 국회의원 친선협회 부회장\r\n - 제19대 한-아랍에미리트 국회의원 친선협회 이사\r\n - 제19대 한-멕시코 국회의원 친선협회 이사\r\n - 제20대 한-베네수엘라 국회의원 친선협회 회장\r\n - 제20대 한-중국 국회의원 외교협의회 부회장\r\n - 제20대 한-노르웨이 국회의원 친선협회 이사','1961-04-29 00:00:00',59,'더불어민주당'),(2677,'김성주','http://www.assembly.go.kr/photo/9771208.jpg','전북 전주시병',9771208,'- 제21대 국회의원(현)\r\n- 국회 보건복지위원회 간사(현)\r\n- 더불어민주당 코로나19국난극복위 방역본부장(현)\r\n- 더불어민주당 정책조정위원회 제6정조위원장 (현)\r\n- 더불어민주당 전북도당위원장(현)\r\n\r\n- 더불어민주당 코로나19국난극복위원회 대변인(전)\r\n- 제16대 국민연금공단 이사장(전)\r\n- 국정기획자문위원회 전문위원(전)\r\n- 민주연구원 부원장(전)\r\n- 더불어민주당 총선공약단 부단장(전)\r\n- 더불어민주당 정책위원회 수석부의장(전) \r\n- 국회 공적연금강화와 노후빈곤 해소를 위한 특별위원회 간사 (전)\r\n- 제19대 국회 후반기 보건복지위원회 간사(전)\r\n- 제19대 국회 운영위원회 위원/원내부대표(전)\r\n- 제19대 국회의원(더불어민주당/전북 전주시 덕진구)','1964-04-10 00:00:00',56,'더불어민주당'),(2682,'이헌승','http://www.assembly.go.kr/photo/9770837.jpg','부산 부산진구을',9770837,'&lt; 학 력 &gt;                \r\n2009 ~ 2011    한국해양대학교 대학원 무역학 박사과정 \r\n1993 ~ 1996    조지워싱턴 대학교 대학원 정치관리학 석사 \r\n1988 ~ 1991    노스웨스턴 대학교 대학원 사회학 석사 \r\n1981 ~ 1988    고려대학교 사회학, 경영학 학사 \r\n1978 ~ 1981    금성고등학교 25회졸업(총동창회 부회장)\r\n1975 ~ 1978    개성중학교 27회졸업(운영위원장)\r\n1969 ~ 1975    개금초등학교 7회졸업(총동창회 회장)\r\n\r\n&lt; 주요경력 &gt;\r\n2012 ~             제19대 국회의원, 새누리당 부산시당 대변인\r\n2011 ~             한나라당 부대변인\r\n2008 ~ 2010      부산광역시청 대외협력보좌관\r\n2007 